import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaChevronDown, FaChevronUp } from 'react-icons/fa';

function RobotListComponent() {
  const [robots, setRobots] = useState([]);
  const [expandedRobotId, setExpandedRobotId] = useState(null);

  useEffect(() => {
    fetchRobots();

    const socket = new WebSocket('ws://your-websocket-url');
    socket.onopen = () => {
      console.log('WebSocket 연결 성공');
    };

    socket.onmessage = (event) => {
      const updatedRobots = JSON.parse(event.data);
      setRobots(updatedRobots); // WebSocket으로 받은 데이터를 로봇 상태로 설정
    };

    socket.onerror = (error) => {
      console.error('WebSocket 오류:', error);
    };

    socket.onclose = () => {
      console.log('WebSocket 연결 종료');
    };

    return () => {
      socket.close(); // 컴포넌트가 언마운트되면 WebSocket 연결 종료
    };
  }, []);

  const getToken = () => {
    const token = localStorage.getItem('token');
    if (!token) {
      alert('토큰이 없습니다. 다시 로그인해주세요.');
      window.location.href = '/login'; // 토큰이 없으면 로그인 페이지로 리디렉션
      return null;
    }
    return token;
  };

  const fetchRobots = async () => {
    const token = getToken();
    if (!token) return;

    try {
      const response = await axios.get('http://172.30.1.28:5559/robot/robots', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setRobots(response.data);
    } catch (error) {
      console.error('로봇 정보 가져오기 오류:', error);
    }
  };

  const toggleExpand = (robotId) => {
    if (expandedRobotId === robotId) {
      setExpandedRobotId(null); // 로봇을 축소
    } else {
      setExpandedRobotId(robotId); // 로봇을 확장
    }
  };

  return (
    <div style={{
      width: '300px',  // 고정된 너비
      height: '600px', // 고정된 높이
      overflowY: 'auto', // 넘칠 경우 수직 스크롤
      border: '1px solid #ccc',
      padding: '20px'
    }}>
      <h3>로봇 리스트</h3>
      <ul style={{ listStyleType: 'none', padding: 0 }}>
        {robots.length > 0 ? (
          robots.map((robot) => (
            <li key={robot._id} style={{ marginBottom: '10px', borderBottom: '1px solid #ddd', padding: '10px' }}>
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <span><strong>이름:</strong> {robot.name}</span>
                <span><strong>상태:</strong> {robot.status?.state || 'Unknown'}</span>
                <span><strong>배터리:</strong> {robot.status?.battery || 'N/A'}%</span>
                <button
                  onClick={() => toggleExpand(robot._id)}
                  style={{ background: 'none', border: 'none', cursor: 'pointer', fontSize: '16px' }}
                  aria-label={expandedRobotId === robot._id ? '접기' : '펼치기'}
                >
                  {expandedRobotId === robot._id ? <FaChevronUp /> : <FaChevronDown />}
                </button>
              </div>
              {expandedRobotId === robot._id && (
                <div style={{ marginTop: '10px', padding: '10px', backgroundColor: '#f9f9f9' }}>
                  <p><strong>IP:</strong> {robot.ip}</p>
                  <p><strong>위치:</strong> x: {robot.location.x}, y: {robot.location.y}</p>
                  <p><strong>속도:</strong> {robot.status?.speed || 'N/A'} m/s</p>
                </div>
              )}
            </li>
          ))
        ) : (
          <p>연결된 로봇이 없습니다.</p>
        )}
      </ul>
    </div>
  );
}

export default RobotListComponent;
